import matplotlib.pyplot as plt
import numpy as np
import random

def norm_len(vec, leng, val):
    nv = np.full(leng,val)
    for i in range(len(vec)):
        nv[i] = vec[i]
    return nv


def myPlotter(avgList, stdList, nameTuple, name, x_ax, y_ax, useStd = True):

    maxLen = 0
    maxVal = -100000
    for el in avgList:
        for i in range(len(el)):
            if(el[i] > maxVal):
                maxVal = el[i]
        print(len(el))
        if(len(el) > maxLen):
            maxLen = len(el)

    for i in range(len(avgList)):
        avgList[i] = norm_len(avgList[i],maxLen, maxVal)

    if(useStd):
        for i in range(len(stdList)):
            stdList[i] = norm_len(stdList[i], maxLen, 0)


    for i in range(len(avgList)):
        plt.plot(avgList[i])
        if(useStd):
            plt.fill_between(np.arange(start=0, stop=len(stdList[i])), np.asarray(avgList[i]) + np.asarray(stdList[i]),
                             np.asarray(avgList[i]) - np.asarray(stdList[i]), alpha=0.5)


    plt.legend(nameTuple)
    plt.ylabel(y_ax)
    plt.xlabel(x_ax)
    plt.title(name)
    plt.show()


